  input: '"TEXT","F3XA","C00084954","Statement for Schedule A Itemized Receipts Supporting
    Line 17:  On July 23, 2005 the Party received $10.00 from the Doug Matayo Campaign
    Fund. On July 22, 2005 the Party received $200.00 from the Denny Altes Campaign
    Fund. These funds were deposited in error in our federal account. We have transferred
    these funds to our non-federal account on August 11, 2005.      Statement for
    Schedules H2 and H4:  The Committee recently discovered two disbursements that
    were reported on our original report as administrative expenses that should have
    been reported as fundraising expenses. The two disbursements were a payment to
    Lance Johnson Photography made on July 18, 2005 in the amount of $1,450.00 and
    a payment to RJs Boot Co. made on July 7, 2005 in the amount of $2,895.00. The
    two disbursements have been reported as fundraising expenses on this amended report.  These
    disbursements were made in connection with the Governors Dinner fundraiser on
    June 20, 2005. We have also amended our Schedule H2 to reflect this fundraising
    event. Using the funds received method for allocating expenses for the Governors
    Dinner fundraising event, we have determined that a ratio adjustment should be
    made and a transfer of funds made to our non-federal account. This transfer of
    $1,694.55 has been made on March 22, 2006 and will be disclosed on our April Monthly
    Report (3/1/06 - 3/31/06) along with a revised Schedule H2 for the Governors Dinner
    fundraiser.  The fundraising expenditures for the Governors Dinner were for our
    party committee only, and not made on behalf of any specifically or clearly identified
    federal candidate. No federal candidates were mentioned in the fundraising activities.
    All expenditures for fundraising were made solely on behalf of our party committee
    and have been properly reported."'
